/* /src/component/main.js */
import React from 'react';
import './Main.css';
import Selector from './Selector';
import Viewer from './Viewer';
import { useMain } from '../states/main_state'; // adjust the path as necessary
import TypewriterText from '../fx/TypewriterText';


const Main = () => {
    const { currentMain } = useMain();


    if (currentMain == "home_main"){
        return (
            <div className="main">
                <div className="main-section"><Selector/></div>
                <div className="main-section"><Viewer/></div>
            </div>
        );
    }   

    if (currentMain == "intro_main"){
        return (
            <div className="page">
                <div className="main-section">
                    <h1><TypewriterText >Overview</TypewriterText></h1>
                    <TypewriterText speed={1}>Skynet is a community driven decentralized compute platform built on top of the Antelope blockchain stack. The main goal of the platform is to be a broker between GPU compute consumers and suppliers. We launched skynet alpha two years ago, today we bring a proposal to the telos community to get skynet to beta and launch on Telos Mainnet. Watch the July 27th Telos Core Developers interview.</TypewriterText>
                </div> 

            </div>
        )
    }

};

export default Main;
